UPDATE `quest_template` SET `Details`='The Tomb of Lights has become corrupted by the Shadow Council and the draenei dead have become cursed spirits, angry and confused with a burning hatred for the living.$b$bEnter the tomb and seek out these tragic victims. Give them the rest that they deserve.' WHERE `entry`=10842;
UPDATE `quest_template` SET `Details`='The time has come to put an end to this unnatural situation, $N. For the Winterfin murlocs to have a chance at a future, Claximus must die!$B$BI want you to take my spare murloc suit and enter the Winterfin Caverns under the pretext of surrender. With the white flag in hand, the murlocs won''t attack you.$B$BYou''ll find him in the southwestern most corner of the caverns. Once you get close enough, deal with Claximus. Bring me one of his claws as proof that the grisly deed has been done.' WHERE `entry`=11566;
UPDATE `quest_template` SET `Details`='Today you unlock a page in your spellbook, one you may not have realized it was there.  Bring me something, and I''ll open it up for you.' WHERE `entry`=11934;
UPDATE `quest_template` SET `Details`='The cave beyond was swarming with Cult atrocities. There is only one way to deal with such creatures... you know what to do.' WHERE `entry`=12264;
UPDATE `quest_template` SET `Details`='Battle still going at Kartak hold... I think it time for you to learn big secret of Frenzyheart.$B$BWe have berries we keep from other lands we came from... they not so special on their own, but mix them with drunk drinks and they make Frenzyheart super strong. You a Frenzyheart now... it time you get to be strong too.$B$BI give some drink, then you be super strong and you go smash all the spark big-tongues.' WHERE `entry`=12760;
UPDATE `quest_template` SET `Details`='I''ve received word of an unfortunate accident at the Dalaran prison; a guard had his arm severed and thrown into the water by a particularly vicious inmate.$b$bOur first aid clinic promises they can reattach the arm if we bring it back.$b$bYou fish long enough in the water outside the prison, and I''d bet my favorite fishing pole that arm will surface.  Find that arm, and bring it to Olisarra the Kind here in Dalaran.  She''ll know what to do.' WHERE `entry`=13836;
UPDATE `quest_template` SET `Details`='While you''re here, you might want to stock up on Teldrassil sweet potatoes. They''re used to make the most delicious candied sweet potatoes you''ve ever tasted.$B$BIf you don''t believe me, look up the recipe in your bountiful cookbook and give it a try. And if there are any extras, you might want to share them with Gregory Tabor at the feasting area just outside Stormwind. They''re one of his favorites, but to hear him tell it, everything''s his favorite!' WHERE `entry`=14033;
UPDATE `quest_template` SET `Details`='Thanks for bringing the candied sweet potatoes. There''s so much cooking to do, I can hardly keep up. And then, Miles sends me a note saying he''s on the verge of running out of stuffing and cranberry chutney. I don''t suppose you''d be willing to step in and whip up some more of each? The vendor should have all the ingredients you need.$B$BYou should be able to find Miles Standish near the feasting tables in the courtyard in the ruins above Undercity.' WHERE `entry`=14044;
UPDATE `quest_template` SET `Details`='$C! Come close quickly, I must have a word!$B$BMy queen, the Lady Sylvanas Windrunner, has uncovered a hole in the defenses of Icecrown Citadel into a place she referred to as "The Forge of Souls." She sent word before she left for me to find fierce fighters to send her way. I think you''ll do.$B$BGo to her within the entrance to the forge, $c.' WHERE `entry`=24506;
UPDATE `quest_template` SET `Details`='$C! Come close quickly, I must have a word!$B$BMy patron, the Lady Jaina Proudmoore, has uncovered a hole in the defenses of Icecrown Citadel into a place she referred to as "The Forge of Souls." She sent word before she left for me to find any help that I could... and, well, I was hoping that might be you.$B$BPlease, find her there as soon as you can.' WHERE `entry`=24510;
UPDATE `quest_template` SET `Details`='Get a load of these guys, would ya? Steamwheedle''s been handling the business of holidays for years, and all of a sudden, these guys bust into the market. They''re not Steamwheedle; the cartel hired me to get to the bottom of this. Something stinks here and it ain''t just perfume.
\

\
Take this device I brought and go analyze the perfume clouds around the guards. I want to know what they''re putting in that stuff. Things ain''t natural.' WHERE `entry`=24536;
UPDATE `quest_template` SET `Details`='I knew they were up to no good! There''s some sort of mind-affecting chemical in here, but I can''t get a handle on it with such a small sample. I need the real stuff.
\

\
Don''t just go over there and buy it! I don''t want you giving these scumbags one copper. Nah, you gotta get it from the source, discreet-like.
\

\
I''ll disguise you as a package runner. I saw a stockpile guarded by their goons outside the gates. Go run by, and DON''T stop, or they''ll make you! They''ll toss you a crate. Bring it back here.' WHERE `entry`=24541;
