UPDATE `quest_template` SET `Details`='Your weapon is ready to be endowed with the power of blood.$b$bYou must face Queen Lana''thel in battle and subject yourself to her Blood Mirror. This will cause Shadow''s Edge to drink the blood of the nearest living being. That being would be you, $r.$b$bOnce the blade has been thus awakened, allow the Queen''s Frenzied Bloodthirst to take hold of you, feed the blade thrice to sate it, and then give the queen an ignominious death.$b$bMay her screams pierce the ears of the Lich King as he awaits his fate.' WHERE `entry`=24756;
UPDATE `quest_template` SET `Details`='These Scourge bloodsuckers -- San''layn they call themselves -- give me the creeps. We''ve had one of our best men keeping an eye on them. But this morning he got sloppy and got himself taken prisoner. He''s being interrogated by the Queen herself right now, and his cries echo through the Crimson Halls. Please, save him before it''s too late!' WHERE `entry`=24879;
